pragma solidity ^0.8.0;

import "../agnostic/Keccak/KeccakInverter.sol";
import "../agnostic/Array.sol";

abstract contract MarketPathStorage {
    using Array for bytes32[];
    function MarketPathKeccak() internal view virtual returns (KeccakInverter);
    function MarketPathIsActiveFromTo(bytes32 fromto_) internal view virtual returns (bool);
    //mapping(bytes32 => bool) internal _fromtoinserted;
    //mapping(bytes32 => bool) internal _fromtoactive;
    mapping(bytes32 => bytes32[]) internal _frompath;
    mapping(bytes32 => bytes32[]) internal _topath;

    function _existPath(bytes32 _from,bytes32 fromto_) public view returns (bool)
    {
        return _frompath[_from].s_exist(fromto_);
    }
}

abstract contract MarketPathReader is MarketPathStorage {


    function _listPathFrom(bytes32 from_)
        public
        view
        returns (bytes32[][] memory out_)
    {
        bytes32[] memory frompath = _frompath[from_];

        out_ = new bytes32[][](frompath.length);
        uint256 count;
        for (uint256 i; i < frompath.length; i++) {
            if (!MarketPathKeccak().exists(frompath[i]))
                continue;
            bytes32[] memory path = MarketPathKeccak().resolveBytes32Array(
                frompath[i]
            );
            require(path.length > 0, "_pathList path.length>0");
            uint256 j;
            for (; j < path.length - 1; j++)
                if (
                    !MarketPathIsActiveFromTo(
                        BytesAndKeccakLib.pureBytes32Bytes32(
                            path[j],
                            path[j + 1]
                        )
                    )
                ) break;
            if (j < path.length - 1) continue;
            out_[count++] = path;
        }
        assembly {
            mstore(out_, count)
        }
        require(count > 0, "_listPathFrom count>0");
    }
    function _listPath(bytes32 from_,bytes32 to_)
        internal
        view
        returns (bytes32[][] memory out_)
    {
        //require(USEFROMTOPATHS&&USEFROMTOORDERS,"_pathList USEFROMTOPATHS && USEFROMTOORDERS");
        /*if (!MarketPathKeccak().exists(fromto_))
            return out_;
        (bytes32 from, bytes32 to) = MarketPathKeccak().resolveBytes32Bytes32(
            fromto_
        );*/
        bytes32[] memory frompath = _frompath[from_];
        require(frompath.length > 0, "_pathList frompath.length>0");

        out_ = new bytes32[][](frompath.length);
        uint256 count;
        for (uint256 i; i < frompath.length; i++) {
            if (!MarketPathKeccak().exists(frompath[i]))
                continue;
            bytes32[] memory path = MarketPathKeccak().resolveBytes32Array(
                frompath[i]
            );
            require(path.length > 0, "_pathList path.length>0");
            if (path[path.length - 1] != to_) continue;
            uint256 j;
            for (; j < path.length - 1; j++)
                if (
                    !MarketPathIsActiveFromTo(
                        BytesAndKeccakLib.pureBytes32Bytes32(
                            path[j],
                            path[j + 1]
                        )
                    )
                ) break;
            if (j < path.length - 1) continue;
            out_[count++] = path;
        }
        assembly {
            mstore(out_, count)
        }
        require(count > 0, "_pathList count>0");
    }
}

abstract contract MarketPathWriter is MarketPathStorage {
    using Array for bytes32[];


    function _insertPath(bytes32 fromto_) internal {
        if (!MarketPathKeccak().exists(fromto_))
            return;

        (bytes32 from, bytes32 to) = MarketPathKeccak().resolveBytes32Bytes32(
            fromto_
        );
        if (_existPath(from,fromto_))
            return;
        bytes32[][] memory filteredfrompath;
        {
            bytes32[] memory frompath = _frompath[to];
            filteredfrompath = new bytes32[][](frompath.length);
            uint256 count;
            for (uint256 i; i < frompath.length; i++) {
                bytes32[] memory path = MarketPathKeccak().resolveBytes32Array(
                    frompath[i]
                );
                if (!path.mexist(from)) filteredfrompath[count++] = path;
            }
            assembly {
                mstore(filteredfrompath, count)
            }
        }
        bytes32[][] memory filteredtopath;
        {
            bytes32[] memory topath = _topath[from];
            filteredtopath = new bytes32[][](topath.length);
            uint256 count;
            for (uint256 i; i < topath.length; i++) {
                bytes32[] memory path = MarketPathKeccak().resolveBytes32Array(
                    topath[i]
                );
                if (!path.mexist(to)) filteredtopath[count++] = path;
            }
            assembly {
                mstore(filteredtopath, count)
            }
        }
        //bytes32[]
        _frompath[from].insert(fromto_);
        _topath[to].insert(fromto_);
        for (uint256 i; i < filteredtopath.length; i++) {
            bytes32[] memory pathplusto = filteredtopath[i].addtail(to);
            bytes32 kpathplusto = MarketPathKeccak().Bytes32Array(pathplusto);
            _frompath[pathplusto[0]].insert(kpathplusto);
            _topath[to].insert(kpathplusto);
        }
        for (uint256 i; i < filteredfrompath.length; i++) {
            bytes32[] memory frompluspath = filteredfrompath[i].addfront(
                from
            );
            bytes32 kfrompluspath = MarketPathKeccak().Bytes32Array(frompluspath);
            _frompath[from].insert(kfrompluspath);
            _topath[frompluspath[frompluspath.length - 1]].insert(kfrompluspath);
        }
        for (uint256 t; t < filteredtopath.length; t++)
            for (uint256 f; f < filteredfrompath.length; f++) {
                bytes32[] memory frompath = filteredfrompath[f];
                bytes32[] memory topath = filteredtopath[f];
                uint256 i;
                for (; i < frompath.length; i++)
                    if (topath.mexist(frompath[i])) break;
                if (i < frompath.length) continue;
                bytes32[] memory path = frompath.combine(topath);
                bytes32 kpath = MarketPathKeccak().Bytes32Array(path);
                _frompath[path[0]].insert(kpath);
                _topath[path[path.length - 1]].insert(kpath);
            }
    }
}
